export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:i,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:i,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:j,pageSize:25,pageCount:j,total:5}}},T5PjuSp3Lb:{data:{id:622,attributes:{imdbId:"tt0112679",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZWEzZGJhNmYtOTkyYi00OTJhLWE3NTItOGFiNDEwYTc4Y2U3XkEyXkFqcGdeQXVyNzQ5MzY0NjM@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.6\u002F10"},{Source:"Rotten Tomatoes",Value:"78%"},{Source:"Metacritic",Value:"70\u002F100"}],item_lang:{data:{id:1285,attributes:{title:c,plot:"'Circle Of Friends' is set in 1950's Ireland. The movie focuses on Benny Hogan and her best friend, Eve Malone. The story centers around Benny and Eve as they enter student life at University College, Dublin. Here Benny and Eve reunite with their childhood friend, the ice-cool Nan Mahon, the 'college belle'. They also encounter the handsome and charming Jack Foley, whom Benny quickly falls for.",slug:"circle-of-friends"}}},books:{data:[{id:4281,attributes:{title:c,description:"Set mainly against the background of a small community, this novel is the story of three girls whose lives, over a period of ten years, become entwined in a bizarre triangle.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=P4-i_eBBhL8C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"2006-01-01",publisher:"Arrow",subtitle:d}},{id:4282,attributes:{title:c,description:k,thumbnail:l,authors:[a],firstBook:e,published:f,publisher:g,subtitle:h}},{id:4283,attributes:{title:c,description:k,thumbnail:l,authors:[a],firstBook:e,published:f,publisher:g,subtitle:h}},{id:4284,attributes:{title:m,description:d,thumbnail:d,authors:[a],firstBook:e,published:"1991-01-01",publisher:d,subtitle:m}},{id:4285,attributes:{title:"Evening Class",description:"It was the quiet ones you had to watch. That's where the real passion was lurking. They came together at Mountainview College, a down-at-the-heels secondary school on the seamy side of Dublin, to take a course in Italian. It was Latin teacher Aidan Dunne's last chance to revive a failing marriage and a dead-end career. But Aidan's dream was headed for disaster until the mysterious Signora appeared, transforming a shared passion for Italy into a life-altering adventure for them all . . . bank clerk Bill and his dizzy fiance Lizzie: a couple headed for trouble . . . Kathy, a hardworking innocent propelled into adulthood in a shocking moment of truth . . . Connie, the gorgeous rich lady with a scandal ready to explode . . . glowering Lou, who joined the class as a cover for crime. And Signora, whose passionate past remained a secret as she changed all their lives forever. . . . From the New York Times bestselling author of This Year It Will Be Different, The Glass Lake, and Circle of Friends, comes a novel filled with Maeve Binchy's signature warmth, wit, and sheer storytelling genius—a spellbinding tale of men and women whose quiet lives hide the most unexpected things. . . .",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=gbWfMfQ7UXsC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:f,publisher:g,subtitle:h}}]}}},meta:{}}},prerenderedAt:1681377256506}}("Maeve Binchy","movie","Circle of Friends","",null,"2007-09-04","Dell","A Novel","series",1,"“[An] irresistible invitation to share the lives of people who believe in enduring values.”—Detroit Free Press It began with Benny Hogan and Eve Malone, growing up, inseparable, in the village of Knockglen. Benny—the only child, yearning to break free from her adoring parents. . . . Eve—the orphaned offspring of a convent handyman and a rebellious blueblood, abandoned by her mother's wealthy family to be raised by nuns. Eve and Benny—they knew the sins and secrets behind every villager's lace curtains . . . except their own. It widened at Dublin, at the university where Benny and Eve met beautiful Nan Mahlon and Jack Foley, a doctor's handsome son. But heartbreak and betrayal would bring the worlds of Knockglen and Dublin into explosive collision. Long-hidden lies would emerge to test the meaning of love and the strength of ties held within the fragile gold bands of a. . . Circle Of Friends. Praise for Circle of Friends “A rare pleasure . . . at terrific tale, told by a master storyteller.”—Susan Isaacs, The New York Times Book Review “Circle of Friends welcomes you in.”—The Washington Post","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9oxUECYelZUC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","Circle of friends"))